import React, { Component } from "react";
import Tabs from "react-bootstrap/Tabs";

class Navbar extends Component {
  constructor(props) {
    super(props);

    this.state = { hidden: false };

    this.showElement = this.showElement.bind(this);
  }

  showElement(e) {
    e.persist();
    console.log(e);
    /*if (this.state.hidden === false) {
      document.getElementsByClassName("education")[0].style.display = "none";

      this.setState({ hidden: true });
    } else {
      document.getElementsByClassName("education")[0].style.display = "block";

      this.setState({ hidden: false });
    }*/
  }

  render() {
    return (
      <Nav
        justify
        variant="tabs"
        defaultActiveKey="background"
        onSelect={this.showElement}
      >
        <Tab eventKey="background">BACKGROUND></Tab>
        <Tab eventKey="education">EDUCATION></Tab>
        <Tab eventKey="experience">EXPERIENCE</Tab>
        <Tab eventKey="skills">SKILLS</Tab>
        <Tab eventKey="apps">SOFTWARE></Tab>
      </Nav>
    );
  }
}

export default Navbar;
